import React, { Component } from 'react'

export default class AboutUs extends Component {
  render() {
    return (
        <React.Fragment>
        <div className="container m-5">
            <div className="row">
                <div className="col-12">
                    <h3>About Us</h3>

                </div>
            </div>
        </div>

    </React.Fragment>
    )
  }
}
